class UptimeRecord extends Model
{
    use HasFactory;

    public $timestamps = false;

    public function monitor()
    {
        return $this->belongsTo(Monitor::class, 'monitor_id');
    }

    public function saveLogs()
    {
        //Lay ra 100 monitors
        $monitors = DB::table('monitors')
            ->where('flag', '=', 'free')
            ->where('status', '=', 'active')
            ->orderBy('updated_at')
            ->select('monitors.id', 'url', 'type', 'status', 'dest_ip', 'flag')
            ->limit(100)
            ->get();

        //Tao mang domains su dung trong curl
        $domains = [];
        $monitorUrls = [];
        $monitorIdsToUpdateStatus_P = [];
        $monitorIdsToUpdateFlag = $monitors->pluck('id');

        DB::table('monitors')
            ->whereIn('id', $monitorIdsToUpdateFlag)
            ->update([
                'flag' => 'processing',
                'updated_at' => now('Asia/Ho_Chi_Minh'),
            ]);

        foreach ($monitors as $monitor) {
            $ip = gethostbyname($monitor->url);
            if ($monitor->dest_ip && $ip !== $monitor->dest_ip) {
                $monitorIdsToUpdateStatus_P[] = $monitor->id;
            }

            $domains[] = $monitor->type . '://' . $monitor->url;
            $monitorUrls[$monitor->id] = $monitor->type . '://' . $monitor->url;
        }

        DB::table('monitors')
            ->whereIn('id', $monitorIdsToUpdateStatus_P)
            ->update([
                'status' => 'pending',
                'updated_at' => now('Asia/Ho_Chi_Minh'),
            ]);

        $requestData = ["domains" => $domains];
        $checkDomainsRequest = json_encode($requestData);

        //Request toi list domain
        $response = $this->checkDomainsAPI($checkDomainsRequest);
        $jsonData = json_decode($response);

        DB::table('monitors')
            ->whereIn('id', $monitorIdsToUpdateFlag)
            ->update([
                'flag' => 'free',
                'updated_at' => now('Asia/Ho_Chi_Minh'),
            ]);
        if ($jsonData) {
            if (property_exists($jsonData, 'data')) {
                $data = $jsonData->data;

                $this->saveUTRsAndIncidents($data, $monitorUrls);
            } else {
                error_log("Data property is undefined.");
            }
        }
    }

    public function whoisAPI()
    {
        $monitors = Monitor::select('id', 'url', 'status')->orderBy('updated_at')->limit(10)->get();
        $monitorIdsToUpdateStatus_E = [];
        $monitorIdsToUpdateStatus_P = [];
        $monitorIdsToUpdateStatus_A = [];

        foreach ($monitors as $monitor) {
            $curl = curl_init();
            curl_setopt_array($curl, array(
                CURLOPT_URL => 'http://whois-api.inet.vn/whois/directly/' . $monitor->url,
                CURLOPT_RETURNTRANSFER => true,
                CURLOPT_ENCODING => '',
                CURLOPT_MAXREDIRS => 10,
                CURLOPT_TIMEOUT => 0,
                CURLOPT_FOLLOWLOCATION => true,
                CURLOPT_HTTP_VERSION => CURL_HTTP_VERSION_1_1,
            ));
            $response = curl_exec($curl);
            curl_close($curl);

            $whoisMonitor = json_decode($response);
            $whoisMonitorCode = $whoisMonitor->code ?: "0";

            if ((int)$whoisMonitorCode === 1) {
                $monitorIdsToUpdateStatus_P[] = $monitor->id;
                continue;
            }

            if (property_exists($whoisMonitor, 'expirationDate_L')) {
                $whoisMonitorExpirationDate = $whoisMonitor->expirationDate_L;
                if ($whoisMonitorExpirationDate / 1000 < now('Asia/Ho_Chi_Minh')->timestamp) {
                    $monitorIdsToUpdateStatus_E[] = $monitor->id;
                } else {
                    $monitorIdsToUpdateStatus_A[] = $monitor->id;
                }
            }
        }

        DB::table('monitors')
            ->whereIn('id', $monitorIdsToUpdateStatus_P)
            ->update([
                'status' => 'pending',
                'updated_at' => now('Asia/Ho_Chi_Minh'),
            ]);

        DB::table('monitors')
            ->whereIn('id', $monitorIdsToUpdateStatus_E)
            ->update([
                'status' => 'expired',
                'updated_at' => now('Asia/Ho_Chi_Minh'),
            ]);

        DB::table('monitors')
            ->whereIn('id', $monitorIdsToUpdateStatus_A)
            ->update([
                'status' => 'active',
                'updated_at' => now('Asia/Ho_Chi_Minh'),
            ]);
    }

    public function checkDomainsAPI($checkDomainsRequest)
    {
        $curl = curl_init();

        curl_setopt_array($curl, array(
            CURLOPT_URL => '103.56.163.62:28091/api/private/check-domains',
            CURLOPT_RETURNTRANSFER => true,
            CURLOPT_ENCODING => '',
            CURLOPT_MAXREDIRS => 10,
            CURLOPT_TIMEOUT => 0,
            CURLOPT_FOLLOWLOCATION => true,
            CURLOPT_HTTP_VERSION => CURL_HTTP_VERSION_1_1,
            CURLOPT_CUSTOMREQUEST => 'POST',
            CURLOPT_POSTFIELDS => $checkDomainsRequest,
            CURLOPT_HTTPHEADER => array(
                'Content-Type: application/json'
            ),
        ));

        $response = curl_exec($curl);
        curl_close($curl);

        return $response;
    }

    public function saveUTRsAndIncidents($data, $monitorUrls)
    {
        foreach ($data as $domainInfo) {
            $paddingTime = 0;
            $timestamp = Carbon::now()->timestamp + $paddingTime;
            $domainName = $domainInfo->name;
            $domainStatusCode = $domainInfo->status_code;
            $domainTime = $domainInfo->time;

            if (strpos($domainInfo->status_message, 'failed to verify certificate') !== false) {
                $domainStatusMessage = "Failed To Verify Certificate";
            } else if (strpos($domainInfo->status_message, 'context deadline exceeded') !== false) {
                $domainStatusMessage = "Connection Timeout";
            } else if (strpos($domainInfo->status_message, 'no such host') !== false || strpos($domainInfo->status_message, 'server misbehaving') !== false) {
                $domainStatusMessage = "Forbidden";
                $domainStatusCode = 403;
            } else {
                $domainStatusMessage = $domainInfo->status_message;
            }

            if (in_array($domainName, $monitorUrls)) {
                $idMonitor = array_search($domainName, $monitorUrls);
                $urlMonitor = $domainName;

                $incidentPre = Incident::where('monitor_id', '=', $idMonitor)
                    ->whereNull('resolved_at')->get()->first();
                $uptimeRecord = new UptimeRecord();

                if ($domainStatusCode !== 200) { //Neu loi thi luu incident
                    if (!$incidentPre) {
                        $incident = new Incident();
                        $incident->status = $domainTime < 10 * 1000 ? 'Ongoing' : 'Slow';
                        $incident->started_at = Carbon::now('Asia/Ho_Chi_Minh');
                        $incident->name = $urlMonitor;
                        $incident->monitor_id = $idMonitor;
                        $incident->count = 1;
                        $incident->latest_checked_at = $timestamp;
                        $incident->latest_status_code = $domainStatusCode;
                        $incident->response_time = $domainTime;
                        $incident->latest_status_message = $domainStatusMessage;
                        $incident->created_at = Carbon::now('Asia/Ho_Chi_Minh');
                        $incident->updated_at = Carbon::now('Asia/Ho_Chi_Minh');
                        $incident->save();
                    } else {
                        $incidentPre->count = $incidentPre->count + 1; //Dem lan check
                        $incidentPre->latest_checked_at = $timestamp;
                        $incidentPre->latest_status_code = $domainStatusCode;
                        $incidentPre->response_time = $domainTime;
                        $incidentPre->latest_status_message = $domainStatusMessage;
                        $incidentPre->save();
                    }

                    $uptimeRecord->is_up = 0;
                } else {
                    if ($incidentPre) {
                        $incidentPre->status = 'Resolved';
                        $incidentPre->created_at = NULL;
                        $incidentPre->resolved_at = now('Asia/Ho_Chi_Minh')->toDateTimeString();
                        $incidentPre->latest_checked_at = $timestamp;
                        $incidentPre->latest_status_code = $domainStatusCode;
                        $incidentPre->response_time = $domainTime;
                        $incidentPre->latest_status_message = $domainStatusMessage;
                        $incidentPre->save();
                    }

                    $uptimeRecord->is_up = 1;
                }

                $statusCodeChanged = true;
                if ($domainStatusCode == 200) {
                    $fiveLatestUptimeRecords = UptimeRecord::where('monitor_id', '=', $idMonitor)
                        ->select('status_code', 'checked_at')
                        ->orderBy('checked_at', 'desc')
                        ->limit(5)
                        ->get();
                    if (count($fiveLatestUptimeRecords) === 5) {

                        $statusCodeChanged = false;
                        foreach ($fiveLatestUptimeRecords as $u) {
                            if ($u->status_code != $domainStatusCode || $timestamp - $fiveLatestUptimeRecords[0]->checked_at > 60 * 60) {
                                $statusCodeChanged = true;
                                break;
                            }
                        }
                    }
                }

                if ($statusCodeChanged) {
                    //Luu uptime record
                    $uptimeRecord->checked_at = $timestamp;
                    $uptimeRecord->status_code = $domainStatusCode;
                    $uptimeRecord->response_time = $domainTime;
                    $header = json_encode($domainInfo);
                    $uptimeRecord->more_info = serialize($header);
                    $uptimeRecord->monitor_id = $idMonitor;
                    $uptimeRecord->save();
                }
            }
        }
    }

